!---------------- Mbs  -----------------	double precision function MbsH(BvL,BvR,BsL,BsR,A1Lc,A1Rc,FLc,FRc,mq1c)		implicit none	#include "NeuQ2qx_Kinematics.h"#include "NeuQ2qx_Model.h"		double precision mq1c	double complex BvL,BvR,BsL,BsR,A1Lc,A1Rc,FLc,FRc			MbsH = 0d0	MbsH = dreal(-((A1Rc*BsL*FLc*m1**3)/(-mq1c**2 + sman)) - (A1Lc*BsR*FRc*m1**3)/(-mq1c**2 + sman) - (A1Rc*BsL*FLc*m1*m2**2)/(-mq1c**2 + sman) - (A1Lc*BsR*FRc*m1*m2**2)/(-mq1c**2 + sman) +      &  (A1Rc*BvL*FLc*m1**2*m2**2)/(-mq1c**2 + sman) + (A1Lc*BvR*FRc*m1**2*m2**2)/(-mq1c**2 + sman) + (A1Rc*BvL*FLc*m2**4)/(-mq1c**2 + sman) + (A1Lc*BvR*FRc*m2**4)/(-mq1c**2 + sman) -      &  (A1Rc*BsR*FLc*m1**2*m3)/(-mq1c**2 + sman) - (A1Lc*BsL*FRc*m1**2*m3)/(-mq1c**2 + sman) + (A1Rc*BvR*FLc*m1**3*m3)/(-mq1c**2 + sman) + (A1Lc*BvL*FRc*m1**3*m3)/(-mq1c**2 + sman) +      &  (A1Rc*BsR*FLc*m2**2*m3)/(-mq1c**2 + sman) + (A1Lc*BsL*FRc*m2**2*m3)/(-mq1c**2 + sman) - (A1Rc*BvR*FLc*m1*m2**2*m3)/(-mq1c**2 + sman) - (A1Lc*BvL*FRc*m1*m2**2*m3)/(-mq1c**2 + sman) -      &  (2*A1Rc*BsL*FLc*m1*m3**2)/(-mq1c**2 + sman) - (2*A1Lc*BsR*FRc*m1*m3**2)/(-mq1c**2 + sman) + (2*A1Rc*BvL*FLc*m2**2*m3**2)/(-mq1c**2 + sman) + (2*A1Lc*BvR*FRc*m2**2*m3**2)/(-mq1c**2 + sman) -      &  (A1Lc*BsL*FLc*m1**2*mq1c)/(-mq1c**2 + sman) - (A1Rc*BsR*FRc*m1**2*mq1c)/(-mq1c**2 + sman) - (A1Lc*BvL*FLc*m1*m2**2*mq1c)/(-mq1c**2 + sman) - (A1Rc*BvR*FRc*m1*m2**2*mq1c)/(-mq1c**2 + sman) -      &  (2*A1Lc*BsR*FLc*m1*m3*mq1c)/(-mq1c**2 + sman) - (2*A1Rc*BsL*FRc*m1*m3*mq1c)/(-mq1c**2 + sman) + (A1Lc*BvR*FLc*m1**2*m3*mq1c)/(-mq1c**2 + sman) + (A1Rc*BvL*FRc*m1**2*m3*mq1c)/(-mq1c**2 + sman) +      &  (A1Lc*BvR*FLc*m2**2*m3*mq1c)/(-mq1c**2 + sman) + (A1Rc*BvL*FRc*m2**2*m3*mq1c)/(-mq1c**2 + sman) - (A1Lc*BsL*FLc*m3**2*mq1c)/(-mq1c**2 + sman) - (A1Rc*BsR*FRc*m3**2*mq1c)/(-mq1c**2 + sman) -      &  (A1Lc*BvL*FLc*m1*m3**2*mq1c)/(-mq1c**2 + sman) - (A1Rc*BvR*FRc*m1*m3**2*mq1c)/(-mq1c**2 + sman) - (A1Rc*BvL*FLc*m2**2*sman)/(-mq1c**2 + sman) - (A1Lc*BvR*FRc*m2**2*sman)/(-mq1c**2 + sman) -      &  (A1Rc*BsR*FLc*m3*sman)/(-mq1c**2 + sman) - (A1Lc*BsL*FRc*m3*sman)/(-mq1c**2 + sman) - (A1Rc*BvR*FLc*m1*m3*sman)/(-mq1c**2 + sman) - (A1Lc*BvL*FRc*m1*m3*sman)/(-mq1c**2 + sman) -      &  (A1Rc*BvL*FLc*m3**2*sman)/(-mq1c**2 + sman) - (A1Lc*BvR*FRc*m3**2*sman)/(-mq1c**2 + sman) - (A1Lc*BvR*FLc*m3*mq1c*sman)/(-mq1c**2 + sman) - (A1Rc*BvL*FRc*m3*mq1c*sman)/(-mq1c**2 + sman) +      &  (A1Rc*BsL*FLc*m1*tman)/(-mq1c**2 + sman) + (A1Lc*BsR*FRc*m1*tman)/(-mq1c**2 + sman) - (A1Rc*BvL*FLc*m2**2*tman)/(-mq1c**2 + sman) - (A1Lc*BvR*FRc*m2**2*tman)/(-mq1c**2 + sman) +      &  (A1Lc*BsL*FLc*mq1c*tman)/(-mq1c**2 + sman) + (A1Rc*BsR*FRc*mq1c*tman)/(-mq1c**2 + sman) + (A1Rc*BsL*FLc*m1*uman)/(-mq1c**2 + sman) + (A1Lc*BsR*FRc*m1*uman)/(-mq1c**2 + sman) -      &  (A1Rc*BvL*FLc*m2**2*uman)/(-mq1c**2 + sman) - (A1Lc*BvR*FRc*m2**2*uman)/(-mq1c**2 + sman) + (A1Lc*BvL*FLc*m1*mq1c*uman)/(-mq1c**2 + sman) + (A1Rc*BvR*FRc*m1*mq1c*uman)/(-mq1c**2 + sman) +      &  (A1Rc*BvL*FLc*sman*uman)/(-mq1c**2 + sman) + (A1Lc*BvR*FRc*sman*uman)/(-mq1c**2 + sman))!        MbsH = dreal((A1Rc*(BsR*FLc*m1**2*m3 - BvR*FLc*m1**3*m3 - BsR*FLc*m2**2*m3 + BvR*FLc*m1*m2**2*m3 + BsR*FRc*m1**2*mq1c + BvR*FRc*m1*m2**2*mq1c + BsR*FRc*m3**2*mq1c + BvR*FRc*m1*m3**2*mq1c + BsR*FLc*m3*sman + BvR*FLc*m1*m3*sman - !      -       BsR*FRc*mq1c*tman + BsL*m1*(2*FRc*m3*mq1c + FLc*(m1**2 + m2**2 + 2*m3**2 - tman - uman)) - BvR*FRc*m1*mq1c*uman + !      -       BvL*(-(FRc*m3*mq1c*(m1**2 + m2**2 - sman)) + FLc*(-(m1**2*m2**2) - m2**4 + sman*(m3**2 - uman) + m2**2*(-2*m3**2 + sman + tman + uman)))) + !      -    A1Lc*(BsL*FRc*m1**2*m3 - BvL*FRc*m1**3*m3 - BsL*FRc*m2**2*m3 + BvL*FRc*m1*m2**2*m3 + BsL*FLc*m1**2*mq1c + BvL*FLc*m1*m2**2*mq1c + BsL*FLc*m3**2*mq1c + BvL*FLc*m1*m3**2*mq1c + BsL*FRc*m3*sman + !      -       BvL*FRc*m1*m3*sman - BsL*FLc*mq1c*tman + BsR*m1*(2*FLc*m3*mq1c + FRc*(m1**2 + m2**2 + 2*m3**2 - tman - uman)) - BvL*FLc*m1*mq1c*uman + !      -       BvR*(-(FLc*m3*mq1c*(m1**2 + m2**2 - sman)) + FRc*(-(m1**2*m2**2) - m2**4 + sman*(m3**2 - uman) + m2**2*(-2*m3**2 + sman + tman + uman)))))/(mq1c**2 - sman))! 	end 	!---------------- Mbt  ----------------	double precision function MbtH(BvL,BvR,BsL,BsR,A2Lc,A2Rc,Gc,mq2c)		implicit none	#include "NeuQ2qx_Kinematics.h"#include "NeuQ2qx_Model.h"		double precision mq2c	double complex BvL,BvR,BsL,BsR,A2Lc,A2Rc,Gc			MbtH = 0d0	MbtH = dreal(-((A2Lc*BsL*Gc*m1**2)/(-mq2c**2 + tman)) - (A2Rc*BsR*Gc*m1**2)/(-mq2c**2 + tman) - (A2Lc*BvL*Gc*m1*m2**2)/(-mq2c**2 + tman) - (A2Rc*BvR*Gc*m1*m2**2)/(-mq2c**2 + tman) - (2*A2Rc*BsL*Gc*m1*m3)/(-mq2c**2 + tman) -      &  (2*A2Lc*BsR*Gc*m1*m3)/(-mq2c**2 + tman) + (A2Rc*BvL*Gc*m1**2*m3)/(-mq2c**2 + tman) + (A2Lc*BvR*Gc*m1**2*m3)/(-mq2c**2 + tman) + (A2Rc*BvL*Gc*m2**2*m3)/(-mq2c**2 + tman) + (A2Lc*BvR*Gc*m2**2*m3)/(-mq2c**2 + tman) -      &  (A2Lc*BsL*Gc*m3**2)/(-mq2c**2 + tman) - (A2Rc*BsR*Gc*m3**2)/(-mq2c**2 + tman) - (A2Lc*BvL*Gc*m1*m3**2)/(-mq2c**2 + tman) - (A2Rc*BvR*Gc*m1*m3**2)/(-mq2c**2 + tman) - (A2Rc*BvL*Gc*m3*sman)/(-mq2c**2 + tman) -      &  (A2Lc*BvR*Gc*m3*sman)/(-mq2c**2 + tman) + (A2Lc*BsL*Gc*tman)/(-mq2c**2 + tman) + (A2Rc*BsR*Gc*tman)/(-mq2c**2 + tman) + (A2Lc*BvL*Gc*m1*uman)/(-mq2c**2 + tman) + (A2Rc*BvR*Gc*m1*uman)/(-mq2c**2 + tman))!        MbtH = dreal((Gc*(A2Lc*(m3*(2*BsR*m1 - BvR*(m1**2 + m2**2 - sman)) + BsL*(m1**2 + m3**2 - tman) + BvL*m1*(m2**2 + m3**2 - uman)) + !      -      A2Rc*(m3*(2*BsL*m1 - BvL*(m1**2 + m2**2 - sman)) + BsR*(m1**2 + m3**2 - tman) + BvR*m1*(m2**2 + m3**2 - uman))))/(mq2c**2 - tman))! 		end				!---------------- Mbu  ----------------	double precision function MbuH(BvL,BvR,BsL,BsR,A3Lc,A3Rc,HLc,HRc,mq3c)		implicit none 	#include "NeuQ2qx_Kinematics.h"#include "NeuQ2qx_Model.h"		double precision mq3c	double complex BvL,BvR,BsL,BsR,A3Lc,A3Rc,HLc,HRc		MbuH = 0d0	MbuH = dreal(-((A3Rc*BsR*HLc*m1**3)/(-mq3c**2 + uman)) - (A3Lc*BsL*HRc*m1**3)/(-mq3c**2 + uman) - (A3Rc*BvR*HLc*m1**2*m2**2)/(-mq3c**2 + uman) - (A3Lc*BvL*HRc*m1**2*m2**2)/(-mq3c**2 + uman) -      &  (A3Rc*BsL*HLc*m1**2*m3)/(-mq3c**2 + uman) - (A3Lc*BsR*HRc*m1**2*m3)/(-mq3c**2 + uman) + (A3Rc*BvL*HLc*m1**3*m3)/(-mq3c**2 + uman) + (A3Lc*BvR*HRc*m1**3*m3)/(-mq3c**2 + uman) +      &  (2*A3Rc*BvL*HLc*m1*m2**2*m3)/(-mq3c**2 + uman) + (2*A3Lc*BvR*HRc*m1*m2**2*m3)/(-mq3c**2 + uman) - (2*A3Rc*BsR*HLc*m1*m3**2)/(-mq3c**2 + uman) - (2*A3Lc*BsL*HRc*m1*m3**2)/(-mq3c**2 + uman) -      &  (A3Rc*BsR*HLc*m1*m4**2)/(-mq3c**2 + uman) - (A3Lc*BsL*HRc*m1*m4**2)/(-mq3c**2 + uman) + (A3Rc*BvR*HLc*m2**2*m4**2)/(-mq3c**2 + uman) + (A3Lc*BvL*HRc*m2**2*m4**2)/(-mq3c**2 + uman) +      &  (A3Rc*BsL*HLc*m3*m4**2)/(-mq3c**2 + uman) + (A3Lc*BsR*HRc*m3*m4**2)/(-mq3c**2 + uman) + (A3Rc*BvL*HLc*m1*m3*m4**2)/(-mq3c**2 + uman) + (A3Lc*BvR*HRc*m1*m3*m4**2)/(-mq3c**2 + uman) -      &  (A3Lc*BsL*HLc*m1**2*mq3c)/(-mq3c**2 + uman) - (A3Rc*BsR*HRc*m1**2*mq3c)/(-mq3c**2 + uman) - (A3Lc*BvL*HLc*m1*m2**2*mq3c)/(-mq3c**2 + uman) - (A3Rc*BvR*HRc*m1*m2**2*mq3c)/(-mq3c**2 + uman) -      &  (2*A3Lc*BsR*HLc*m1*m3*mq3c)/(-mq3c**2 + uman) - (2*A3Rc*BsL*HRc*m1*m3*mq3c)/(-mq3c**2 + uman) + (A3Lc*BvR*HLc*m1**2*m3*mq3c)/(-mq3c**2 + uman) + (A3Rc*BvL*HRc*m1**2*m3*mq3c)/(-mq3c**2 + uman) +      &  (A3Lc*BvR*HLc*m2**2*m3*mq3c)/(-mq3c**2 + uman) + (A3Rc*BvL*HRc*m2**2*m3*mq3c)/(-mq3c**2 + uman) - (A3Lc*BsL*HLc*m3**2*mq3c)/(-mq3c**2 + uman) - (A3Rc*BsR*HRc*m3**2*mq3c)/(-mq3c**2 + uman) -      &  (A3Lc*BvL*HLc*m1*m3**2*mq3c)/(-mq3c**2 + uman) - (A3Rc*BvR*HRc*m1*m3**2*mq3c)/(-mq3c**2 + uman) + (A3Rc*BsR*HLc*m1*sman)/(-mq3c**2 + uman) + (A3Lc*BsL*HRc*m1*sman)/(-mq3c**2 + uman) -      &  (A3Rc*BvR*HLc*m1**2*sman)/(2.*(-mq3c**2 + uman)) - (A3Lc*BvL*HRc*m1**2*sman)/(2.*(-mq3c**2 + uman)) - (A3Rc*BvR*HLc*m2**2*sman)/(2.*(-mq3c**2 + uman)) - (A3Lc*BvL*HRc*m2**2*sman)/(2.*(-mq3c**2 + uman)) -      &  (A3Rc*BvL*HLc*m1*m3*sman)/(-mq3c**2 + uman) - (A3Lc*BvR*HRc*m1*m3*sman)/(-mq3c**2 + uman) - (A3Rc*BvR*HLc*m3**2*sman)/(2.*(-mq3c**2 + uman)) - (A3Lc*BvL*HRc*m3**2*sman)/(2.*(-mq3c**2 + uman)) -      &  (A3Rc*BvR*HLc*m4**2*sman)/(2.*(-mq3c**2 + uman)) - (A3Lc*BvL*HRc*m4**2*sman)/(2.*(-mq3c**2 + uman)) - (A3Lc*BvR*HLc*m3*mq3c*sman)/(-mq3c**2 + uman) - (A3Rc*BvL*HRc*m3*mq3c*sman)/(-mq3c**2 + uman) +      &  (A3Rc*BvR*HLc*sman**2)/(2.*(-mq3c**2 + uman)) + (A3Lc*BvL*HRc*sman**2)/(2.*(-mq3c**2 + uman)) + (A3Rc*BsR*HLc*m1*tman)/(-mq3c**2 + uman) + (A3Lc*BsL*HRc*m1*tman)/(-mq3c**2 + uman) +      &  (A3Rc*BvR*HLc*m1**2*tman)/(2.*(-mq3c**2 + uman)) + (A3Lc*BvL*HRc*m1**2*tman)/(2.*(-mq3c**2 + uman)) + (A3Rc*BvR*HLc*m2**2*tman)/(2.*(-mq3c**2 + uman)) + (A3Lc*BvL*HRc*m2**2*tman)/(2.*(-mq3c**2 + uman)) -      &  (A3Rc*BvL*HLc*m1*m3*tman)/(-mq3c**2 + uman) - (A3Lc*BvR*HRc*m1*m3*tman)/(-mq3c**2 + uman) + (A3Rc*BvR*HLc*m3**2*tman)/(2.*(-mq3c**2 + uman)) + (A3Lc*BvL*HRc*m3**2*tman)/(2.*(-mq3c**2 + uman)) +      &  (A3Rc*BvR*HLc*m4**2*tman)/(2.*(-mq3c**2 + uman)) + (A3Lc*BvL*HRc*m4**2*tman)/(2.*(-mq3c**2 + uman)) + (A3Lc*BsL*HLc*mq3c*tman)/(-mq3c**2 + uman) + (A3Rc*BsR*HRc*mq3c*tman)/(-mq3c**2 + uman) -      &  (A3Rc*BvR*HLc*tman**2)/(2.*(-mq3c**2 + uman)) - (A3Lc*BvL*HRc*tman**2)/(2.*(-mq3c**2 + uman)) + (A3Rc*BvR*HLc*m1**2*uman)/(2.*(-mq3c**2 + uman)) + (A3Lc*BvL*HRc*m1**2*uman)/(2.*(-mq3c**2 + uman)) -      &  (A3Rc*BvR*HLc*m2**2*uman)/(2.*(-mq3c**2 + uman)) - (A3Lc*BvL*HRc*m2**2*uman)/(2.*(-mq3c**2 + uman)) - (A3Rc*BsL*HLc*m3*uman)/(-mq3c**2 + uman) - (A3Lc*BsR*HRc*m3*uman)/(-mq3c**2 + uman) -      &  (A3Rc*BvR*HLc*m3**2*uman)/(2.*(-mq3c**2 + uman)) - (A3Lc*BvL*HRc*m3**2*uman)/(2.*(-mq3c**2 + uman)) - (A3Rc*BvR*HLc*m4**2*uman)/(2.*(-mq3c**2 + uman)) - (A3Lc*BvL*HRc*m4**2*uman)/(2.*(-mq3c**2 + uman)) +      &  (A3Lc*BvL*HLc*m1*mq3c*uman)/(-mq3c**2 + uman) + (A3Rc*BvR*HRc*m1*mq3c*uman)/(-mq3c**2 + uman) + (A3Rc*BvR*HLc*uman**2)/(2.*(-mq3c**2 + uman)) + (A3Lc*BvL*HRc*uman**2)/(2.*(-mq3c**2 + uman)))!        MbuH = dreal((A3Rc*(2*BsR*(HRc*mq3c*(m1**2 + m3**2 - tman) + HLc*m1*(m1**2 + 2*m3**2 + m4**2 - sman - tman)) + !      &      2*m3*(-(BvL*(HRc*mq3c*(m1**2 + m2**2 - sman) + HLc*m1*(m1**2 + 2*m2**2 + m4**2 - sman - tman))) + BsL*(2*HRc*m1*mq3c + HLc*(m1**2 - m4**2 + uman))) + !      &       BvR*(2*HRc*m1*mq3c*(m2**2 + m3**2 - uman) + HLc*((m3**2 + m4**2 - sman - tman)*(sman - tman) + m1**2*(2*m2**2 + sman - tman - uman) + (m3**2 + m4**2)*uman - uman**2 + m2**2*(-2*m4**2 + sman - tman + uman)))) + !      &    A3Lc*(2*BsL*(HLc*mq3c*(m1**2 + m3**2 - tman) + HRc*m1*(m1**2 + 2*m3**2 + m4**2 - sman - tman)) + !      &       2*m3*(-(BvR*(HLc*mq3c*(m1**2 + m2**2 - sman) + HRc*m1*(m1**2 + 2*m2**2 + m4**2 - sman - tman))) + BsR*(2*HLc*m1*mq3c + HRc*(m1**2 - m4**2 + uman))) + !      &       BvL*(2*HLc*m1*mq3c*(m2**2 + m3**2 - uman) + HRc*((m3**2 + m4**2 - sman - tman)*(sman - tman) + m1**2*(2*m2**2 + sman - tman - uman) + (m3**2 + m4**2)*uman - uman**2 + m2**2*(-2*m4**2 + sman - tman + uman)))))/!      &  (2.*(mq3c**2 - uman)))! 	        end